export default function Bottom_Plate_3_Inch({frameColor}) {
  const { nodes, materials } = useGLTF('/Bottom_Plate_3_Inch.gltf')
  return (
        <mesh geometry={nodes.mesh_0.geometry} material={nodes.mesh_0.material} >
          <meshStandardMaterial
              attach="material"
              color={frameColor}
          />
        </mesh>

  )
}

